import chair from '../../image/chair.png';
import { Container, Wrapper, Image, SlideTitle,LeftSlide } from './styles';

function Slider() {
  return(
      <Container>
          <Wrapper>
              <LeftSlide>

                <SlideTitle>Modelos que combinam <br /> com você</SlideTitle>

                <p>
                    Lorem Ipsum is simply dummy text of the printing and typesetting industry.<br />
                    Lorem Ipsum has been the industry's standard dummy <br />
                    text ever since the 1500s, when an unknown printer <br />
                    took a galley of type and scrambled it to make a type specimen book.<br />
                    software like Aldus PageMaker including versions of Lorem Ipsum.
                </p>

              </LeftSlide>
            <Image src={chair} alt="chair"/>
          </Wrapper>
      </Container>
  );
}

export default Slider;
